insert into dataset values( 23, 15, 23, '10.5524/100035', 'Resources for the MeDUSA (Methylated DNA Utility for Sequence Analysis) MeDIP-seq computational analysis pipeline for the identification of differentially methylated regions, and associated methylome data from 18 wild-type and mutant mouse ES, NP and MEF cells.', 'Here we present 18 genome-wide DNA methylation profiles of wild type and Thymine DNA glycosylase (<em>Tdg</em>) knockout cells, which serve as an excellent murine methylome resource. The 18 samples represent 6 biological cohorts: 6 samples were derived from mouse embryonic stem cells (3 <em>Tdg+/-</em>, 3 <em>Tdg-/-</em>), 6 samples were from mouse neural precursor cells (3 <em>Tdg+/-</em>, 3 <em>Tdg-/-</em>) and 6 samples were obtained from mouse embryonic fibroblasts (3 <em>Tdg+/+</em>, 3 <em>Tdg-/-</em>).
